import React from 'react';
import './styles.css';

const App = () => {
    return (
        <>
            <body className="min-h-screen bg-grey-800">
                <h1>Test</h1>
            </body>
        </>
    );
}
// first commit comment

const NewBubbleButton = () => {
    return (
        <button className="newBubbleButton">
            +
        </button>
    )
}
export default App;
